import 'dart:convert';
import 'dart:typed_data';

import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';
import 'package:font_awesome_flutter/font_awesome_flutter.dart';
import 'package:fore_end/MyTool/LocalDataManager.dart';

import 'Plan.dart';

class User{
  static const String defaultAvatar="";
  static const String defaultUsername="defaultUsername";
  static const List<Icon> genderIcons = [
    Icon(FontAwesomeIcons.horse,color: Colors.grey,size: 30),
    Icon(FontAwesomeIcons.male,color: Colors.lightBlueAccent,size: 30),
    Icon(FontAwesomeIcons.female,color: Colors.pinkAccent,size: 30),
  ];
  String _token;
  int _uid;
  int _age;
  //male - 1, female - 2, other - 0
  String _planType;
  int _gender;
  String _userName;
  String _email;
  String _avatar_local;
  String _avatar_remote;

  User({ String username=User.defaultUsername, int planType=0,int age, int gender, int uid, String avatar=User.defaultAvatar, String token, String email}){
    this._userName = username;
    this._token = token;
    this._email = email;
    this._uid = uid;
    this._gender = gender;
    this._age = age;
    if(planType == null){
      planType = 0;
    }
    this._planType = Plan.planType[planType];
    if(avatar == null){
      this._avatar_remote =User.defaultAvatar;
    }else{
      List<String> stringVal = avatar.split(',');
      if(stringVal.length == 2){
        this._avatar_remote = stringVal[1];
      }else if(stringVal.length == 1){
        this._avatar_remote = stringVal[0];
      }else{
        this._avatar_remote = "";
      }
    }
  }

  int get uid => _uid;
  String get token => _token;
  String get email => _email;
  String get userName => _userName;

  String get planType => _planType;

  set planType(String value) {
    _planType = value;
  }

  int get age => _age;

  set age(int value) {
    _age = value;
  }

  set uid(int value) {
    _uid = value;
  }

  String getRemoteAvatar(){
    return _avatar_remote;
  }
  String getLocalAvatar(){
    return _avatar_local;
  }
  Image getAvatar(double width, double height){
    return Image.memory(
      base64Decode(this._avatar_remote),
      width: width,
      height:height,
      fit: BoxFit.cover,
    );
  }
  Uint8List getAvatarBin(){
    return base64Decode(this._avatar_remote);
  }

  set token(String value) {
    _token = value;
  }

  void save(){
    LocalDataManager.saveUser(this);
  }

  set userName(String value) {
    _userName = value;
  }

  set email(String value) {
    _email = value;
  }

  set avatar_local(String value) {
    _avatar_local = value;
  }

  set avatar_remote(String value) {
    _avatar_remote = value;
  }

  int get gender => _gender;

  set gender(int value) {
    _gender = value;
  }
  void logOut(){
    LocalDataManager.deleteUser();
  }
  Icon genderIcon(){
    return User.genderIcons[this.gender];
  }
}